import React, { Fragment } from 'react';
import {Route} from "react-router";

import './App.css';
import Header from "../Header";
import Content from "../Content";
import Footer from "../Footer";

const App = () => {
  return (
      <Fragment>
          <Header />
          <Content />
          <Footer />
      </Fragment>
  );
};

export default App;
